import axios from 'axios'
import { useContext, useEffect, useState } from 'react';
import { useParams } from 'react-router-dom'

const Moredetails = () => {
  const [recipe,setrecipe]=useState()
  let params=useParams()
  console.log(params);
  useEffect(function(){
    axios.get(`http://localhost:1234/Users/getbyid${params.id}`).then(l=>{})
  },[])
  return (
    <p>{params.name}--{params.description}--{params.pic}--{params.level}--{params.duration}--{params.type}--{params.id}--{params.component}</p>
  )
}

export default Moredetails
